sys_variable_value.value:
(function execute(inputs, outputs) {
   var notify = new sn_notify.NotifyScoped();
   var from = '+12253963290';
   var to = inputs["to"];
   new notify.sendSMS(from, to, 'Hi '+ inputs["name"]+", "+'\n'+ 'Your appointment is Confirmed by Doctor :  '+inputs["doctorName"]+'\n' + 'Date of Appointment : '+ inputs["date"] + "\n"+'Time Slot : ' + inputs["timeSlot"] + "Please be available 15 min prior.");
})(inputs, outputs);

